import React from "react";
import { Card, Button } from "react-bootstrap";
import Projects from "../components/Projects";
export default function Portfolio({}) {
  const projects = [
    {
      name: "Kode Keeper",
      description: "App for holding snippets of code",
      id: 1,
      link: "http/",
    },
  ];

  return (
    <>
      <h1>Projects</h1>
      <Projects />
      <Projects />
      <Projects />
    </>
  );
}
